import './App.css';

function App() {
  const title = "Welcome to my new blog";
  const likes = 50;
  const link = "https://www.google.com"

  return (
    <div className="App">
      <div className="content">
        <h1>{title}</h1>
        <p>Liked {likes} times</p>
        <p>{"Hey, there"}</p>
        <p>{[1,2,4,5]}</p>
        <p>{Math.random() * 10 }</p>
        <a href={link}>Google</a>
      </div>
    </div>
  );
}

export default App;
